var urbanGrowth = {} || window.urbanGrowth;

//inner function
urbanGrowth.loadFile = function (ext) {
  var fId = ext+"-file";
  var fread = new FileReader();
  switch (ext) {
    case "ma":
      var f = new File(urbanGrowth.MA,"urbanGrowth."+ext);
      fread.readAsText(f);
      fread.onloadend = function(){
    		inp.file[fId] = fread.result;
        console.log("DEMO URB GROWTH MA loaded");
        grid.model.name = f.name.slice(0, f.name.lastIndexOf('.'));
        //start loading the .pal file after .ma is done loading
        urbanGrowth.loadFile("pal");
      }
      break;
    case "pal":
      var f = new File(urbanGrowth.PAL,"urbanGrowth."+ext);
      fread.readAsText(f);
      fread.onloadend = function(){
    		inp.file[fId] = fread.result;
        console.log("DEMO URB GROWTH PAL loaded");
        //start loading the .val file after .pal is done loading
        urbanGrowth.loadFile("val");
      }
      break;
    case "log":
      var f = new File(urbanGrowth.LOG,"urbanGrowth."+ext);
      inp.logFile = f;
			inp.logLoaded = true;
      console.log("DEMO URB GROWTH LOG ready for parse");
      //load the simulation after all files are loaded
      grid.loadSimulation();
      break;
    case "val":
        var f = new File(urbanGrowth.VAL,"urbanGrowth."+ext);
        fread.readAsText(f);
        fread.onloadend = function(){
      		inp.file[fId] = fread.result;
          console.log("DEMO URB GROWTH VAL loaded");
          //start loading the .log file after .val is done loading
          urbanGrowth.loadFile("log");
        }
        break;
  }
}
// function to be linked to the button
urbanGrowth.loadUrbGrowth = function () {
  //start loading the files frim the .ma file
  inp.file = [];
  inp.logLoaded = false;
  inp.logFile = null;
  grid.initialStValues=[];
  urbanGrowth.loadFile("ma");
}

